    render() {
        return (
            <Container>
                <div className={"bread-crumb-cont mt-5 m-b5"}>
                    <a href="#hp">Ana Sayfa</a> > <a href="#hp">Sepetim</a>
                </div>
            </Container>
        );
    }
}

export default BreadCrumb;
